import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from 'react';

function App() {
  const [data, setData] = useState({'slides':'','variables':''});
  useEffect(() => {
    fetch("/api/12345")
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);

  return (
    <div className="App">
      <header className="App-header"> 
        <p>Value A: {data.variables}</p>
        <p>Value B: {data.slides}</p>
      </header>
    </div>
  );
}

export default App;
